import React from 'react';
import { fade, makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import MailIcon from '@material-ui/icons/Mail';
import HomeIcon from '@material-ui/icons/Home';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import DescriptionIcon from '@material-ui/icons/Description';
import SettingsApplicationsIcon from '@material-ui/icons/SettingsApplications';
import ReferencesIcon from '@material-ui/icons/CheckCircle';
import EducationIcon from '@material-ui/icons/School';
import MoreIcon from '@material-ui/icons/MoreVert';

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    display: 'none',
    [theme.breakpoints.up('sm')]: {
      display: 'block',
    },
  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginRight: theme.spacing(2),
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(3),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('md')]: {
      width: '20ch',
    },
  },
  sectionDesktop: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'flex',
    },
  },
  sectionMobile: {
    display: 'flex',
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
}));

export default function PrimarySearchAppBar() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = React.useState(null);

  const list = [
    {name: "Home", icon: <HomeIcon />},
    {name: "Education", icon: <EducationIcon />},
    {name: "Projects", icon: <SettingsApplicationsIcon />},
    {name: "LinkedIn", icon: <LinkedInIcon />},
    {name: "Resume", icon: <DescriptionIcon />},
    {name: "References", icon: <ReferencesIcon />},
    {name: "Contact", icon: <MailIcon />}
  ];

  const mobileMenuOptions = list.map( option => {
    return (
      <div>lol</div>
      // <MenuItem>
      //   <IconButton color="inherit">
      //       {option.icon}
      //   </IconButton>
      //   <p>{option.name}</p>
      // </MenuItem>
    )
  });

  console.log(mobileMenuOptions);

  const isMenuOpen = Boolean(anchorEl);
  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    handleMobileMenuClose();
  };

  const handleMobileMenuOpen = (event) => {
    setMobileMoreAnchorEl(event.currentTarget);
  };

  const menuId = 'primary-search-account-menu';
  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      id={menuId}
      keepMounted
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
      open={isMenuOpen}
      onClose={handleMenuClose}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
    </Menu>
  );

  const mobileMenuId = 'primary-search-account-menu-mobile';
  const renderMobileMenu = (
    <Menu
      anchorEl={mobileMoreAnchorEl}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      id={mobileMenuId}
      keepMounted
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
    >

      {mobileMenuOptions}

      <MenuItem>
        <IconButton color="inherit">
            <HomeIcon />
        </IconButton>
        <p>Home</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit">
            <EducationIcon />
        </IconButton>
        <p>Education</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit">
            <SettingsApplicationsIcon />
        </IconButton>
        <p>Projects</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit">
            <LinkedInIcon />
        </IconButton>
        <p>LinkedIn</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit">
            <DescriptionIcon />
        </IconButton>
        <p>Resume</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit">
            <ReferencesIcon />
        </IconButton>
        <p>References</p>
      </MenuItem>

      <MenuItem>
        <IconButton color="inherit" >
          <MailIcon />
        </IconButton>
        <p>Contact</p>
      </MenuItem>
    </Menu>
  );

  return (
    <div className={classes.grow}>
      <AppBar position="static">
        <Toolbar>
          <Typography className={classes.title} variant="h6" noWrap>
            Daniel Morales
          </Typography>
          <div className={classes.grow} />
          <div className={classes.sectionDesktop}>

            <IconButton color="inherit">
                <HomeIcon />
            </IconButton>

            <IconButton color="inherit">
                <EducationIcon />
            </IconButton>

            <IconButton color="inherit">
                <SettingsApplicationsIcon />
            </IconButton>

            <IconButton color="inherit">
                <LinkedInIcon />
            </IconButton>

            <IconButton color="inherit">
                <DescriptionIcon />
            </IconButton>

            <IconButton color="inherit">
                <ReferencesIcon />
            </IconButton>

            <IconButton color="inherit">
                <MailIcon />
            </IconButton>

          </div>
          <div className={classes.sectionMobile}>
            <IconButton
              aria-label="show more"
              aria-controls={mobileMenuId}
              aria-haspopup="true"
              onClick={handleMobileMenuOpen}
              color="inherit"
            >
              <MoreIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>
      {renderMobileMenu}
      {renderMenu}
    </div>
  );
}


